import WhatsApp from "./lib/components/ChatExtension";
import Logo from "./lib/components/avatardefault.jpg";
import "./App.css";

function App() {
  const accounts = [
    {
      name: "123",
      position: "Example: Sales Support Unit",
      account: "98912*******",
      avatar: <img src={Logo} alt="" />,
      status: false,
    },    {
      name: "Example: Sales",
      position: "Example: Sales Support Unit",
      account: "98912*******",
      avatar: <img src={Logo} alt="" />,
      status: true,
    },
  ];

  return (
    <div>
      <p>Test whatsApp.</p>
      <WhatsApp
        tooltipTitle={"Do you have any questions about this product?"}
        tooltipDescription="Chat via WhatsApp"
        title={"start chat"}
        lead={"Please chat on WhatsApp"}
        description={"Responsive, usually respond in minutes."}
        accountList={accounts}
        // backgroundColor="green"

      />
      <WhatsApp
        dir="rtl"
        position="right"
        tooltipTitle={"در مورد این محصول سوالی دارید؟"}
        tooltipDescription="چت از طریق واتس‌اپ"
        title={"شروع مکالمه"}
        lead={"لطفا در واتس‌اپ چت نمایید."}
        description={"پاسخگو،‌به طور معمول در چند دقیقه پاسخ می‌دهد"}
        accountList={accounts}
        // backgroundColor="red"
      />
    </div>
  );
}

export default App;

